    function _withdrawlAvatar(uint _badgeTokenId)  internal virtual returns (bool){

        address badgeOwner = ownerOf(_badgeTokenId);
        address avatarAddress = IDCardInfo[_badgeTokenId].avatarTokenAddress;
        uint avatarTokenId = IDCardInfo[_badgeTokenId].avatarTokenId;

        ERC721 avatar = ERC721(avatarAddress);

        if (avatar.ownerOf(avatarTokenId) == address(this)) {
            ERC721(avatarAddress).safeTransferFrom(address(this), badgeOwner, avatarTokenId);
        }

        return true;
    }

    function onERC721Received(address operator, address from, uint256 tokenId, bytes calldata data)
     external returns (bytes4) {
        require(this.balanceOf(from) >= 1);

        uint badgeNumber = tokenOfOwnerByIndex(from, 1);

        ERC721 tokenRecieved = ERC721(msg.sender);

        ERC721(msg.sender).approve(from, tokenId);

        _withdrawlAvatar(badgeNumber);        
        require(tokenRecieved.ownerOf(tokenId) == address(this));
        _updateAvatar(badgeNumber, msg.sender, tokenId);
        return this.onERC721Received.selector;
     }


