    function _burnAllBadges() internal returns (bool) {
        // burn all badges
        uint256 index = 0;
        for (index = 0; index < _tokenIdGenerator; index++) {
            if (_exists(index)) {
                _burn(index);
            }   
        }
        _tokenIdGenerator = 0;
        return true;
    }

